import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

const name = "Marry";

root.render(
  <section>
    <header>Header</header>
    <nav>Menu</nav>
    <main>Main content</main>
    <footer>Footer</footer>
  </section>
);
